function getPoisHousingL(){
    for (var i = 0; i < 45; i++) {
        var page = i + 1;
        request(`https://restapi.amap.com/v3/place/text?key=c7aeb11746b35a92b7b6eee3178a05e4&keywords=&types=190403&city=150402&children=1&offset=20&page=${page}&extensions=all`, function (error, response, body) {
            var obj = JSON.parse(body);
            var pois = obj.pois;
            var ids = "";
            console.log(pois);

            pois.forEach(function(poi){
                ids += `{"poiId":"${poi.id}","poiLocation":"${poi.location}","poiLng":"${poi.location.split(",")[0]}","poiLat":"${poi.location.split(",")[1]}","poiName":"${poi.name}","poiType":"${poi.type}","poiAddress":"${poi.address}","poiBounds":"null","poiPcode":"${poi.pcode}","poiPname":"${poi.pname}","poiCitycode":"${poi.citycode}","poiCityname":"${poi.cityname}","poiAdcode":"${poi.adcode}","poiAdname":"${poi.adname}","poiRegion":"${poi.pname}${poi.cityname}${poi.adname}","poiVillage":"${poi.parent}"},`;
            });
            fs.appendFile("./poisHousingL.txt", ids, (error)=> {
                if (error) return console.log("追加文件失败" + error.message);
                console.log("追加成功");
            });
        });
    }
}



function getPoisHousingLBounds(){

    for (var i = 800; i < 900 ; i++){
        // console.log(`https://ditu.amap.com/detail/${poisHousing[i].poiId}/?src=mypage&callnative=0`);
        request(`https://ditu.amap.com/detail/${poisHousingL[i].poiId}/?src=mypage&callnative=0`, function (error, response, body) {
            // console.log(poi.poiId);
            // console.log(body);

            if (body !== undefined){
                console.log(body.indexOf(`"shape":"`));
                if (body.indexOf(`"shape":"`) !== -1){
                    // console.log(poi.poiId);
                    // console.log(body);
                    var path = [];
                    var start = body.indexOf(`"shape":"`)+9;
                    var end = "";
                    if (body.indexOf(`","parentid"`) !== -1){
                        end = body.indexOf(`","parentid"`);
                    } else {
                        end = body.indexOf(`","level"`);
                    }
                    var start2 = body.indexOf(`"poiid":"`)+9;
                    var end2 = body.indexOf(`","tag"`);
                    var poiId = body.slice(start2,end2);

                    // var end = body.indexOf(`","level"`);
                    // console.log(body.slice(start,end));
                    // console.log('*************************');
                    body.slice(start,end).split(";").forEach(function(pointW){
                        var point = pointW.split(",");
                        var long = Number(point[0]);
                        var lat = Number(point[1]);
                        path.push([long,lat]);
                    });

                    //poisHousing1to300[i]["poiBounds"] = JSON.stringify(path);
                    // poisHousing[i]["poiBounds"] = JSON.stringify(path);
                    path = JSON.stringify(path);
                    fs.appendFile("./poisHousingLBounds.txt", `{"poiId":"${poiId}","poiBounds":"${path}"},`, (error)=> {
                        if (error) return console.log("追加文件失败" + error.message);
                        console.log("追加成功");
                    });
                }
            }
        });
    }
}

function getPoisHousingLFinal(){
    poisHousingLBounds.forEach(function(bound){
        for (var i = 0; i < poisHousingL.length; i++){
            if (poisHousingL[i].poiId === bound.poiId){
                poisHousingL[i].poiBounds = bound.poiBounds;
                break;
            }
        }
    });
    fs.appendFile("./poisHousingLF.txt", JSON.stringify(poisHousingL), (error)=> {
        if (error) return console.log("追加文件失败" + error.message);
        console.log("追加成功");
    });
}

